package com.zhzx.dao.model.order;import com.zhzx.dao.model.BaseModel;public class OrderInfoModel extends BaseModel {		/**	*订单编号	*/	private String id;		/**	*客户编号	*/	private String custno;		/**	*地址编号	*/	private String addno;		/**	*状态（1:生成订单，2：等待发货，3：完成，-1:订单取消，-2：订单过期）	*/	private String status;		/**	*	*/	private String createtime;		/**	*	*/	private String updatetime;			public String getId() {	    return this.id;	}	public void setId(String id) {	    this.id=id;	}	public String getCustno() {	    return this.custno;	}	public void setCustno(String custno) {	    this.custno=custno;	}	public String getAddno() {	    return this.addno;	}	public void setAddno(String addno) {	    this.addno=addno;	}	public String getStatus() {	    return this.status;	}	public void setStatus(String status) {	    this.status=status;	}	public String getCreatetime() {	    return this.createtime;	}	public void setCreatetime(String createtime) {	    this.createtime=createtime;	}	public String getUpdatetime() {	    return this.updatetime;	}	public void setUpdatetime(String updatetime) {	    this.updatetime=updatetime;	}	}